import React from "react";
import "./Header.css";
import "./HorizontalneListe";
import HorizontalnaLista from "./HorizontalneListe";
import LargeButton from "./LargeButton";

function Header()
{
    const fontVel = "15px";
    const visina = "80px";
    const sirina = "100px";
    return(
        <header>
            <div>
                <HorizontalnaLista
                    prvi={<LargeButton value="#TECH" fontSize="20px"/>}
                />
            </div>
            <div id="saStrane">
                <HorizontalnaLista
                    prvi={<LargeButton value="PROFILE" fontSize={fontVel} height={visina} width={sirina}/>}
                    drugi={<LargeButton value="CART" fontSize={fontVel} height={visina} width={sirina}/>}
                    treci={<LargeButton value="SHOP" fontSize={fontVel} height={visina} width={sirina}/>}
                    cetvrti={<LargeButton value="LOG OUT" fontSize={fontVel} height={visina} width={sirina}/>}
                />
            </div>
        </header>
    );
}

export default Header;
